import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import NavButtons from "../NavButtons/NavButtons.jsx";

const Education = (props) => {
  const useStyles = makeStyles((theme) => ({
    root: {
      "& > *": {
        marginTop: theme.spacing(2),
        width: "50ch",
      },
    },
  }));
  const classes = useStyles();
  const { step, setStep } = props;
  const [values, setValues] = React.useState({
    college: "",
    from: "",
    to: "",
    degree: "",
    cgpa: "",
  });
  const [errors, setErrors] = React.useState({
    college: false,
    from: false,
    to: false,
    degree: false,
    cgpa: false,
  });
  const [errorMessages, setErrorMessages] = React.useState({
    college: "",
    from: "",
    to: "",
    degree: "",
    cgpa: "",
  });
  const validateInfo = () => {};

  return (
    <div>
      <Card className="card">
        <CardContent>
          <form className={classes.root} autoComplete="on">
            <TextField
              label="College"
              variant="outlined"
              value={values.college}
              onChange={(event) => onValueChange("college", event)}
              error={errors.college}
              helperText={errors.college && errorMessages.college}
              required
            />
            <TextField
              label="Joining Year"
              variant="outlined"
              value={values.from}
              onChange={(event) => onValueChange("from", event)}
              error={errors.from}
              helperText={errors.from && errorMessages.from}
              required
            />
            <TextField
              label="Expected Year of Graduation"
              variant="outlined"
              value={values.to}
              onChange={(event) => onValueChange("to", event)}
              error={errors.to}
              helperText={errors.to && errorMessages.to}
              required
            />
            <TextField
              label="Degree"
              variant="outlined"
              value={values.degree}
              onChange={(event) => onValueChange("degree", event)}
              error={errors.degree}
              helperText={errors.degree && errorMessages.degree}
              required
            />
            <TextField
              label="CGPA"
              variant="outlined"
              value={values.cgpa}
              onChange={(event) => onValueChange("cgpa", event)}
              error={errors.cgpa}
              helperText={errors.cgpa && errorMessages.cgpa}
              required
            />
          </form>
        </CardContent>
      </Card>
      <NavButtons {...props} validateInfo={validateInfo} />
    </div>
  );
};

export default Education;
